INSERT INTO `wisatas` (`id`, `nama`, `deskripsi`, `koordinat_x`, `koordinat_y`, `status_pengelolaan`, `harga_tiket`, `status_tiket`, `created_at`, `updated_at`) VALUES
(1, 'Air Terjun Sirah Kencong', 'Air Terjun Sirah Kencong menawarkan panorama air terjun yang asri dan alami. Terletak di tengah hutan yang rindang, pengunjung bisa menikmati udara segar dan suasana yang tenang. Cocok untuk pecinta alam dan fotografi.', -7.9735710, 112.4342243, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(2, 'Arung Parang', 'Bagi pencinta petualangan, Arung Parang menyajikan aktivitas arung jeram dengan aliran sungai yang cukup menantang. Selain itu, pemandangan sekitarnya juga menawarkan keindahan alam Blitar yang masih alami.', -7.9961159, 112.3583385, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(3, 'Lekso Tubing Adventure', 'Lekso Tubing Adventure memberikan pengalaman seru melintasi aliran sungai dengan ban karet. Pengunjung bisa menikmati arus sungai sambil melihat pemandangan alam sekitar yang hijau dan menyegarkan.', -7.9663060, 112.3659200, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(4, 'Ngeli ban Minggirsari', 'Ngeli Ban Minggirsari merupakan destinasi wisata air yang unik. Pengunjung bisa merasakan sensasi bermain air dengan ban di aliran sungai yang tenang. Tempat ini juga cocok untuk rekreasi keluarga.', -8.1432700, 112.1684440, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(5, 'Badherbank', 'Badherbank dikenal dengan suasana alamnya yang sejuk dan pemandangan hijau yang luas. Cocok untuk wisatawan yang ingin bersantai atau melakukan aktivitas outdoor seperti piknik dan trekking ringan.', -8.1694870, 112.3586800, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(6, 'Taman Wisata Bendungan Lodoyo', 'Taman Wisata Bendungan Lodoyo menawarkan keindahan bendungan dengan pemandangan air yang luas. Selain itu, tersedia fasilitas untuk bersantai, bersepeda, atau sekadar menikmati udara segar di sekitar bendungan.', -8.1492680, 112.1905680, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(7, 'Taman Wisata Bendungan Wlingi Raya', 'Taman ini memiliki daya tarik berupa pemandangan bendungan yang dikelilingi oleh bukit dan pepohonan. Pengunjung bisa menikmati keindahan alam sambil berfoto atau sekadar berjalan-jalan di sekitar area.', -8.1395260, 112.2486300, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(8, 'Kawasan Wisata Ngreeo/Lahor', 'Kawasan Wisata Ngreeo atau Lahor menyuguhkan suasana perbukitan yang hijau dan udara sejuk. Selain itu, kawasan ini juga menawarkan aktivitas trekking ringan dan spot foto alam yang menarik.', -8.1467900, 112.4523580, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(9, 'Bendung Sumber Dandang', 'Bendung Sumber Dandang merupakan destinasi wisata air yang menawarkan pemandangan bendungan yang memukau. Tempat ini sering dijadikan spot memancing dan bersantai oleh warga sekitar.', -7.9626700, 112.3696170, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(10, 'Rambut Monte', 'Rambut Monte terkenal dengan telaga alami yang jernih serta candi peninggalan sejarah di sekitarnya. Selain itu, terdapat mitos menarik mengenai ikan-ikan di telaga yang menambah daya tarik wisata ini.', -7.9612900, 112.3685110, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(11, 'Sumur Amber', 'Sumur Amber merupakan destinasi unik dengan sejarah dan mitos lokal. Air sumur ini dianggap memiliki khasiat tertentu oleh masyarakat setempat. Suasananya yang tenang cocok untuk wisata religi atau budaya.', -8.0831890, 112.1069050, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(12, 'Telaga Pacoh', 'Telaga Pacoh menyajikan pemandangan telaga yang jernih dengan lingkungan sekitar yang hijau dan alami. Tempat ini cocok untuk rekreasi keluarga atau sekadar menikmati suasana alam yang damai.', -7.9902560, 112.2207950, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-15 01:34:11'),
(13, 'Gua Embul Tuk', 'Gua Embul Tuk menawarkan pengalaman petualangan masuk ke dalam gua dengan stalaktit dan stalagmit yang indah. Selain pemandangan dalam gua, area sekitar juga memiliki alam yang asri.', -8.2995840, 112.1025290, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(14, 'Hutan Pinus Gogoniti', 'Hutan Pinus Gogoniti menyuguhkan pemandangan hutan pinus yang menjulang tinggi. Udara sejuk dan suasana alamnya cocok untuk piknik, berkemah, atau sekadar berjalan-jalan santai.', -8.0694010, 112.4019540, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(15, 'Hutan Pinus Loji', 'Hutan Pinus Loji juga menawarkan suasana alami dengan deretan pohon pinus yang indah. Tempat ini menjadi spot favorit untuk berfoto dan rekreasi keluarga.', -7.9623890, 112.3498470, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(16, 'Taman Ayu Gogoniti', 'Taman Ayu Gogoniti menghadirkan taman hijau dengan berbagai fasilitas untuk keluarga. Pengunjung bisa menikmati udara segar, bermain di taman, atau sekadar bersantai di area yang nyaman.', -8.0652520, 112.4127430, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(17, 'Jati Park', 'Jati Park menawarkan suasana teduh di antara pepohonan jati yang rindang. Tempat ini menyediakan fasilitas rekreasi keluarga dan sering digunakan untuk kegiatan outdoor atau gathering.', -8.0552740, 112.3650490, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(18, 'Kesambi Trees Park', 'Kesambi Trees Park memiliki daya tarik berupa pohon-pohon Kesambi yang unik dan suasana alam yang sejuk. Tersedia juga area bermain untuk anak-anak dan spot foto yang menarik.', -8.0669100, 112.1215310, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(19, 'Perkebunan Teh Sirah Kencong', 'Perkebunan Teh Sirah Kencong memberikan pemandangan hijau yang memanjakan mata. Pengunjung bisa melihat langsung proses pengolahan teh serta menikmati segelas teh hangat di kafe sekitar.', -7.9761370, 112.4301030, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(20, 'Pendakian Gn. Kelud via Tulungrejo', 'Jalur pendakian Gunung Kelud via Tulungrejo menawarkan trek yang menantang dengan panorama alam yang indah. Selain menikmati pemandangan gunung, pengunjung juga bisa melihat kawah aktif yang memukau.', -7.9597170, 112.3477430, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(21, 'Pendakian Gn. Kelud via Karangrejo', 'Jalur pendakian ini menawarkan pengalaman mendaki yang menantang dengan pemandangan indah di sepanjang perjalanan. Cocok bagi pendaki pemula maupun berpengalaman.', -8.0168020, 112.2505420, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(22, 'Kaleenata Family Camp', 'Tempat ini menyediakan area camping yang nyaman untuk keluarga dengan berbagai fasilitas lengkap. Suasana alamnya mendukung aktivitas outdoor dan rekreasi bersama keluarga.', -8.0018490, 112.3371970, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(23, 'Kali Kebo Camping Ground', 'Kali Kebo Camping Ground\r\n', -7.9931690, 112.3344847, 'dikelola', 10000, 'berbayar', '2025-03-15 06:12:13', '2025-03-15 06:12:13'),
(24, 'KWE Puspa Jagad', 'KWE Puspa Jagad menghadirkan taman edukasi dan konservasi dengan berbagai koleksi flora. Cocok untuk wisata keluarga dan edukasi anak-anak.', -7.9917740, 112.3424330, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(25, 'Puncak Sekawan', 'Puncak Sekawan menawarkan pemandangan perbukitan dan lembah yang indah. Tempat ini cocok untuk menikmati sunrise atau sekadar bersantai di alam terbuka.', -7.9969310, 112.3784120, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(26, 'Pantai Pangi', 'Pantai Pangi memiliki pasir putih dan ombak yang tenang, cocok untuk bermain air atau sekadar bersantai di tepi pantai.', -8.3123030, 112.1102420, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(27, 'Pantai Tambakrejo', 'Pantai ini menawarkan panorama laut dengan pasir putih dan ombak yang cukup tenang. Fasilitas di sekitar pantai juga memadai untuk wisata keluarga.', -8.3152460, 112.1431130, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(28, 'Pantai Pasir Putih Pasetran Gondomayit', 'Pantai ini memiliki pasir putih bersih dan suasana yang masih alami. Tempat ini cocok untuk berfoto atau menikmati pemandangan laut.', -8.3218330, 112.1464519, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(29, 'Pantai Pudak', 'Pantai Pudak menawarkan keindahan alam pantai yang eksotis dengan suasana tenang dan jauh dari keramaian.', -8.3272243, 112.2027024, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(30, 'Pantai Serit', 'Pantai Serit dikenal dengan hamparan pasirnya yang luas dan pemandangan laut yang mempesona. Tempat ini cocok untuk bersantai dan menikmati alam.', -8.3274096, 112.2144734, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(31, 'Pantai Serang', 'Pantai Serang menawarkan keindahan pasir putih dan suasana yang tenang. Setiap tahun, pantai ini juga menjadi lokasi upacara adat Larung Sesaji.', -8.3314592, 112.2220422, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(32, 'Pantai Jolosutro', 'Pantai Jolosutro memiliki pemandangan yang eksotis dengan pasir hitam dan ombak besar, cocok untuk pecinta surfing dan fotografi alam.', -8.3321319, 112.2887115, 'dikelola', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(33, 'Air Terjun Lawean Kawisari', 'Air Terjun Lawean Kawisari menyajikan panorama air terjun yang tinggi dan alami. Suasana sekitar yang asri menjadikannya destinasi favorit untuk relaksasi.', -7.8821340, 111.7867536, 'dibebaskan', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(34, 'Air Terjun Tirto Galuh', 'Air Terjun Tirto Galuh menawarkan keindahan air terjun bertingkat dengan kolam alami di bawahnya, cocok untuk berenang dan bermain air.', -8.2653755, 112.0594675, 'dibebaskan', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(35, 'Air Terjun Bidadari', 'Air Terjun Bidadari menawarkan pemandangan alam yang menakjubkan dengan aliran air jernih yang mengalir deras dari tebing tinggi. Suasana sejuk dan segar di sekitar air terjun membuatnya cocok untuk bersantai dan menikmati alam.', -8.2535503, 112.2592053, 'dibebaskan', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(36, 'Air Terjun Njumeg', 'Air Terjun Njumeg memiliki pesona air terjun bertingkat dengan aliran air yang membentuk kolam alami di bawahnya. Keindahan alam sekitar dan suara gemericik air menciptakan suasana tenang dan damai.', -8.3033239, 112.3206181, 'dibebaskan', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(37, 'Air Terjun Jurug Bening', 'Air Terjun Jurug Bening dikenal dengan kejernihan airnya yang mempesona. Lokasinya yang dikelilingi oleh pepohonan hijau membuatnya menjadi tempat yang asri untuk berwisata alam.', -8.2724911, 112.3102397, 'dibebaskan', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(38, 'Gua Kedung Krombang', 'Gua Kedung Krombang menyajikan petualangan seru dengan pemandangan stalaktit dan stalagmit yang unik di dalam gua. Pengunjung bisa menikmati suasana misterius dan keindahan alami gua ini.', -8.2967184, 112.2347376, 'dibebaskan', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(39, 'Konyar Hill', 'Konyar Hill menawarkan pemandangan dari ketinggian dengan lanskap perbukitan hijau yang memukau. Waktu terbaik untuk berkunjung adalah saat matahari terbit atau terbenam untuk mendapatkan momen yang instagramable.', -8.1447046, 112.3906462, 'dibebaskan', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(40, 'puncak Langit', 'puncak Langit adalah destinasi wisata alam di puncak bukit dengan pemandangan langit yang luas dan indah. Tempat ini cocok untuk menikmati pemandangan alam dari ketinggian dan berfoto.', -8.0120849, 112.4517729, 'dibebaskan', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(41, 'Sumber Bon C', 'Sumber Bon C merupakan sumber mata air alami dengan air yang sangat jernih. Pengunjung bisa merasakan kesegaran air langsung dari sumbernya, cocok untuk tempat bersantai bersama keluarga.', -8.0098459, 112.2512702, 'dibebaskan', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(42, 'Pantai Pasur', 'Pantai Pasur memiliki hamparan pasir putih yang luas dan air laut yang biru jernih. Ombak yang tenang membuat pantai ini cocok untuk berenang atau sekadar bermain di tepi pantai.', -8.3173353, 112.0619554, 'dibebaskan', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(43, 'Pantai Gayasan', 'Pantai Gayasan menawarkan keindahan pantai dengan pemandangan tebing karang dan deburan ombak. Suasana alam yang masih alami menjadi daya tarik utama pantai ini.', -8.3153471, 112.1118011, 'dibebaskan', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(44, 'Pantai Umbul Waru', 'Pantai Umbul Waru terkenal dengan pemandangan laut lepas dan tebing-tebing yang menjulang tinggi. Pengunjung bisa menikmati keindahan laut dari atas tebing atau sekadar bersantai di pantai.', -8.3149191, 112.0794772, 'dibebaskan', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(45, 'Pantai Banteng Mati', 'Pantai Banteng Mati memiliki suasana yang tenang dan masih jarang dikunjungi wisatawan. Pasir hitamnya yang eksotis dan ombak yang tenang menjadikannya tempat yang nyaman untuk beristirahat.', -8.3249147, 112.1669917, 'dibebaskan', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(46, 'Pantai Jebring', 'Pantai Jebring menawarkan pemandangan laut biru yang memesona dengan hamparan pasir yang lembut. Suasana di pantai ini sangat asri, cocok untuk berlibur bersama keluarga.', -8.3238569, 112.1423483, 'dibebaskan', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-15 01:32:19'),
(47, 'Pantai Keben', 'Pantai Keben menyajikan pemandangan alam yang memukau dengan ombak besar yang menjadi daya tarik bagi para peselancar. Keindahan alam sekitar juga memberikan pengalaman wisata yang menyenangkan.', -8.3240241, 112.1526906, 'dibebaskan', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(48, 'Pantai Bakung', 'Pantai Bakung merupakan pantai yang masih alami dengan pasir putih dan pemandangan laut yang mempesona. Ombak yang cukup besar juga cocok bagi pengunjung yang gemar berselancar.', -8.3273241, 112.1981103, 'dibebaskan', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(49, 'Pantai Bukit Indah', 'Pantai Bukit Indah memiliki pemandangan yang unik dengan perpaduan antara pantai dan bukit hijau di sekitarnya. Lokasi ini sangat cocok untuk menikmati panorama alam dan berfoto.', -8.3386546, 112.2636772, 'dibebaskan', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44'),
(50, 'Pantai Peh Pulo', 'Pantai Peh Pulo menawarkan suasana tenang dengan pasir putih yang bersih dan air laut yang jernih. Pengunjung bisa berenang, bermain air, atau sekadar menikmati keindahan alam di sekitar pantai.', -8.3439309, 112.1935514, 'dibebaskan', 10000, 'berbayar', '2025-03-10 16:30:44', '2025-03-10 16:30:44');
